import {useParams} from "react-router-dom";
import classes from "./Dialog.module.css";

function Department() {
  const params = useParams();

  return (
      <div className={`${classes.dialogText}`}>
        ✨ Hello, my dialog id is {params.id} ✨
      </div>
  );
}

export default Department;
